  \"Oceanographic profile data collected from CTD casts aboard NAVIGATION RESPONSE
  TEAM 4 as part of project OPR-K414-NRT4-13 in the Gulf of Mexico from 2014-07-01
  to 2014-09-09 (NCEI Accession 0130652)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
